trasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"105885","type":"Paragraph"},{"attributes":{},"id":"105996","type":"UnionRenderers"},{"attributes":{"days":[1,8,15,22]},"id":"103202","type":"DaysTicker"},{"attributes":{},"id":"105997","type":"Selection"},{"attributes":{"data_source":{"id":"103804"},"glyph":{"id":"103805"},"hover_glyph":null,"muted_glyph":null,"name":" Esp\u00edrito Santo","nonselection_glyph":{"id":"103806"},"selection_glyph":null,"view":{"id":"103808"}},"id":"103807","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":0.5},"x":{"field":"x"},"y":{"field":"y"}},"id":"103309","type":"Circle"},{"attributes":{},"id":"103851","type":"UnionRenderers"},{"attributes":{},"id":"103748","type":"UnionRenderers"},{"attributes":{"line_alpha":0.1,"line_color":"#1f78b4","line_width":1.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"103841","type":"Line"},{"attributes":{"line_alpha":0.6,"line_color":"#a6cee3","line_width":1.8,"x":{"field":"x"},"y":{"field":"y"}},"id":"103313","type":"Line"},{"attributes":{"source":{"id":"1037
